function geoFindMe(e) {
  e.preventDefault();
  e.stopImmediatePropagation();
  var status = document.querySelector('#status');
  var mapLink = document.querySelector('#map-link');
  mapLink.href = '';
  mapLink.textContent = '';

  function success(position) {
    var latitude = position.coords.latitude;
    var longitude = position.coords.longitude; //const latitude  = 48.8704;
    //const longitude = 2.3168;

    status.textContent = '';
    mapLink.href = "https://www.openstreetmap.org/#map=18/".concat(latitude, "/").concat(longitude);
    mapLink.textContent = "Latitude: ".concat(latitude, " \xB0, Longitude: ").concat(longitude, " \xB0");
    fetch("https://api-adresse.data.gouv.fr/reverse/?lon=".concat(longitude, "&lat=").concat(latitude, "&type=housenumber&limit=15")).then(e => e.json(), e => {
      alert('error: ' + e);
    }).then(e => {
      console.log(e.features); // todo handle error missing

      var address = e.features[0].properties;

      if (address.distance > 1000) {
        alert("Too far!"); // todo move this to html
      }

      if (address.scope < 0.95) {
        alert("Low address score!"); // todo move this to html
      }

      streetInput.value = address.name;
      cityInput.value = address.city;
      postCodeInput.value = address.postcode;
    });
  }

  function error() {
    switch (error.code) {
      case error.TIMEOUT:
        alert("Browser geolocation error !\n\nTimeout.");
        break;

      case error.PERMISSION_DENIED:
        alert("Browser geolocation error !\n\nPermission error (".concat(error.message, ")."));
        break;

      case error.POSITION_UNAVAILABLE:
        alert("Browser geolocation error !\n\nPosition unavailable.");
        break;
    }

    status.textContent = 'Unable to retrieve your location';
  }

  if (!navigator.geolocation) {
    status.textContent = 'Geolocation is not supported by your browser';
  } else {
    status.textContent = 'Locating…';
    navigator.geolocation.getCurrentPosition(success, error, {
      enableHighAccuracy: true,
      maximumAge: 60000,
      timeout: 10000
    });
  }
}

